import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <div className="intro">
          <h1>Yellow is a Happy Color</h1>
          <p>Yellow makes you feel happy and spontaneous. Yellow is perhaps the most energetic of the warm colors. It is associated with laughter, hope and sunshine.</p>
        </div>
      </header>
    </div>
  );
}

export default App;
